The list of searchplugins is stored in JSON format: For Firefox desktop in browser/components/search/searchplugins/list.json . For Firefox for Android in mobile/android/components/search/searchplugins/list.json . The default search engine is defined as searchDefault in a default key, together with a list of searchplugins and their searchOrder: "default": { "searchDefault": "Google", "searchOrder": ["Google", "Bing"], "visibleDefaultEngines": [ "google", "amazondotcom", "bing", "ddg", "ebay", "twitter", "wikipedia" ]
} Unlike the list in visibleDefaultEngines, searchDefault and searchOrder require the searchplugin name, defined as ShortName in the corresponding XML file. For example, in google.xml: <SearchPlugin xmlns="http://www.mozilla.org/2006/browser/search/">
<ShortName>Google</ShortName>
<Description>Google Search</Description> If a locale is missing from list.json, or doesn’t provide any of these values, the default key is used as a fallback. Since Google is the default for most locales, this system allows to avoid defining the same searchDefault for each locale. The same is valid for searchOrder, using Google and Bing as first two searchplugins for most locales. The basic structure for each locale is fairly simple. Assuming the locale code is ur, it will have a default key, with visibleDefaultEngines. "ur": { "default": { "visibleDefaultEngines": [ "google", "bing", "amazon-in", "ddg", "wikipedia-ur" ] }
}, Notes about the list: If the searchplugin XML file is called google.xml, the item to add to visibleDefaultEngines will be only google, without the extension but also respecting the case . Only searchDefault and searchOrder use the ShortName of the searchplugin. Order should reflect the actual order of searchplugins: if Google is default, and Bing 2nd, the list should start with "google", "bing". The remaining searchplugins can be in alphabetical order. If a locale is missing from list.json, it will fall back to default, defined at the beginning of the file. A locale can also have regional overrides, for example: "be": { "default": { "visibleDefaultEngines": [ "yandex-by", "google", "ddg", "wikipedia-be", "wikipedia-be-tarask" ] }, "BY": { "searchDefault": "Яндекс" }, "KZ": { "searchDefault": "Яндекс" }, "RU": { "searchDefault": "Яндекс" }, "TR": { "searchDefault": "Яндекс" }
} This defines a different default engine for Belarussian in 4 countries, each one indicated by its country code . A locale can also override the default search order: "cs": { "default": { "searchOrder": ["Google", "Seznam"], "visibleDefaultEngines": [ "google", "seznam-cz", "ddg", "heureka-cz", "mapy-cz", "wikipedia-cz" ] }
} To make sure you’re not creating a broken JSON, you can test the final content with an online validator like jsonlint .

