Bedrock supports l10n tags through the l10n_has_tag function. For example: {% if l10n_has_tag('sync_device_note') %} {{ _('Learn more about bookmarks') }}
{% else %} {{ _('Learn more') }}
{% endif %} l10n tags allow to add a new string in the template and to push it to production without waiting for localization to happen: if the l10n .lang file has this tag, the template will use the new string Learn more about bookmarks, otherwise if will fallback to the previous version Learn more. The tag appears as sync_device_note in the code, but it will appear as ## sync_device_note ## at the beginning of the .lang file. Using underscores is preferable to dashes for tag names. It’s possible to add tags to l10n files by using the add tags script available in Langchecker. It will add tags only if the file translated all strings associated to it. All tags are enabled by default on a DEV server. For more information about .lang files, for example how to bind a string to a tag, see the wiki page .

